# 데이터 리스트 전처리
tag_list = []
for row in musinsa_data_list:
    check = 0
    tmp_list = []
    for j in row:
        if '2017-' in j:
            check = 1
            break
        elif '//image.musinsa.com' in j:
            tmp_list.insert(0,j)
        elif '2018-' in j:
             tmp_list.insert(1,j)
        elif type(j) == int:
            continue
        elif ' / ' in j:
            pass
        else:
            if j == '유니크/키치' or j == '섹시/페미닌' or j == '스트리트/힙합' or j == '심플/캐주얼' or j == '워크/밀리터리' or j =='포멀/클래식' or j == '아티스트/뮤지션' or j == '전문직/프리랜서' or j == '방송/연예인':
                tmp_list.append(j.split('/')[0])
                tmp_list.append(j.split('/')[1])
            else:
                tmp_list.append(j)
    if check == 0:
        tag_list.append(tmp_list)


# 수집한 데이터를 데이터프레임에 저장
col = ['image','date','tag1','tag2','tag3','tag4','tag5','tag6','tag7','tag8','tag9']
data=pd.DataFrame(data=tag_list, columns=col)
